Input: A species of small rodent eats seeds from only one species of pine. In normal years, a pair of these rodents will have a litter of two or three. It is unusual for small rodents to have such small litter sizes. The rodents are most likely to exhibit which other characteristic? Choices: a) Moderate sexual size dimorphism b) High parental investment c) Precocial young d) Frequent extrapair matings 
Output:
First, I need to identify the key characteristics of the species of small rodent. The species eats seeds from only one species of pine, which suggests that it is specialized to a particular food source.
Next, I need to consider the implications of the small litter size. Small litter sizes are often associated with high parental investment, as parents need to devote more resources to each offspring to ensure their survival.
Now, I need to consider the other options. Moderate sexual size dimorphism is not necessarily related to litter size, and precocial young are not typically associated with small litter sizes. Frequent extrapair matings are not directly related to litter size either.
Therefore, the correct answer is {'sol': 'b'}. {'sol': 'b'}.

